struct AXIS_wLAST{
	float data;
	bool last;
};

#define ALPHA 0.5
float elu(float x) {
	if (x >= 0) {
		return x;
	}
	return ALPHA * (hls::exp(x) - 1);
}

float relu(float x) {
	if (x >= 0) {
		return x;
	}
	return 0;
}

float sigmoid(float x) {
	return 1.0 / (1 + hls::exp(-1.0 * x));
}

float dot_product(float a[], float b[], int n) {
	float sum = 0.0;
	for (int l = 0; l < n; l++) {
		sum += a[l] * b[l];
	}
	return sum;
}

void softmax(float a[]) {
	int i;
	float sum = 0;
	for (i = 0; i < OUTPUT_SIZE; i++) {
		a[i] = hls::exp(a[i]);
		sum += a[i];
	}
	for (i = 0; i < OUTPUT_SIZE; i++) {
		a[i] = a[i] / sum;
	}
}

